import "./nav.css"
import {Typography,Button,Stack} from "@mui/material"
import {Link} from "react-router-dom";  
function NavBar(){
    return (
        <>
            <nav className="navConatiner">
                <div>
                <Typography variant="h4"  fontWeight="bold">Shopy</Typography>
                </div>
                <div>
                    {/* <Stack spacing={2} direction={"row"}> */}
                        <Link to="/addstocks"   className="link">
                            <Button variant="contained" color="success" >Add Stock</Button>
                        </Link>
                        <Link to="/" className="link">
                            <Button variant="contained" color="info">Home</Button>
                        </Link>
                    {/* </Stack> */}
                </div>
            </nav>
        </>
    )
}
export default NavBar;
